import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { MapContainer, TileLayer, CircleMarker, Tooltip, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import '../css/todaydust.css';
import cityMapping from '../region_mapping/cityMapping.js';
import cityCoordinates from '../region_mapping/cityPosition.js';

const TodayDust = () => {
  const [dustData, setDustData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(
          'https://apis.data.go.kr/B552584/ArpltnStatsSvc/getCtprvnMesureLIst?itemCode=PM10&dataGubun=HOUR&pageNo=1&numOfRows=1&returnType=json&serviceKey=zhvs5TlKznNkfpG91l4BPgIcZtbsxovufWhyA4%2Bw2KcaA1dp6RsGVOYHyD91i%2FXzDfAqOFIdScVjvbElsw%2BBCQ%3D%3D'
        );
        const data = await response.json();
        setDustData(data.response.body.items[0]);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching data:', error);
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) {
    return <div className="loading">Loading...</div>;
  }

  if (!dustData || dustData.length === 0) {
    return <div>데이터를 불러올 수 없습니다. 다시 시도해주세요.</div>;
  }

  const cities = Object.entries(dustData).filter(
    ([key]) => key !== 'dataTime' && key !== 'dataGubun' && key !== 'itemCode'
  );

  const getColorByPM10 = (value) => {
    if (!value || value === '-') return 'rgba(128, 128, 128, 0.7)';
    const pmValue = parseFloat(value);
    if (pmValue <= 15) return 'rgba(76, 80, 175, 0.7)';
    if (pmValue <= 35) return 'rgba(76, 175, 80, 0.7)';
    if (pmValue <= 75) return 'rgba(255, 245, 89,0.7)';
    if (pmValue <= 150) return 'rgba(255, 152, 0, 0.7)';
    return 'rgba(244, 67, 54, 0.7)';
  };

  const getMarkerStyleByPM10 = (value) => {
    if (!value || value === '-') return {
      radius: 15,
      color: 'rgba(128, 128, 128, 0.6)',
      fillColor: 'rgba(128, 128, 128, 0.4)',
      weight: 2,
    };
    const pmValue = parseFloat(value);
    const baseStyle = {
      weight: 3,
      fillOpacity: 0.6,
      color: getColorByPM10(value),
      fillColor: getColorByPM10(value),
    };
    if (pmValue <= 15) return { ...baseStyle, radius: 20 };
    if (pmValue <= 35) return { ...baseStyle, radius: 22.5 };
    if (pmValue <= 75) return { ...baseStyle, radius: 25 };
    if (pmValue <= 150) return { ...baseStyle, radius: 27.5 };
    return { ...baseStyle, radius: 50 };
  };

  return (
    <div className="dust-container">
      <header className="dust-header">
        <h1>TodayDust Page</h1>
      </header>

      <main className="dust-content">
        <p>오늘의 미세먼지 지도</p>

        <MapContainer
          center={[36.5, 128.0]}
          zoom={7}
          dragging={false}
          scrollWheelZoom={false}
          zoomControl={false}
          className="map-container"
        >
          <TileLayer
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            attribution="&copy; <a href='https://www.openstreetmap.org/copyright'>OpenStreetMap</a> contributors"
            maxZoom={19}
          />

          {cities.map(([city, value]) => {
            const coordinates = cityCoordinates[cityMapping[city]];
            if (!coordinates) return null;

            const markerStyle = getMarkerStyleByPM10(value);

            return (
              <CircleMarker
                key={city}
                center={coordinates}
                radius={markerStyle.radius}
                color={markerStyle.color}
                fillColor={markerStyle.fillColor}
                fillOpacity={markerStyle.fillOpacity}
                weight={markerStyle.weight}
              >
                <Tooltip permanent direction="center" className="dust-tooltip" offset={[0, 0]}>
                  <span style={{
                    fontWeight: 'bold',
                    color: 'rgba(0,0,0,0.7)',
                    fontSize: '16px',
                    textShadow: '1px 1px 2px rgba(255,255,255,0.5)'
                  }}>
                    {cityMapping[city]}
                  </span>
                </Tooltip>
                <Popup>
                  <div style={{
                    textAlign: 'center',
                    fontFamily: 'Roboto, sans-serif',
                    color: '#333'
                  }}>
                    <strong style={{ fontSize: '16px', color: '#007bff' }}>
                      {cityMapping[city]}
                    </strong> <br />
                    미세먼지(PM10): <span style={{ fontWeight: 'bold' }}>{value}㎍/m³</span> <br />
                    상태:
                    <span style={{
                      fontWeight: 'bold',
                      color: getColorByPM10(value)
                    }}>
                      {parseFloat(value) <= 30 ? '좋음' :
                        parseFloat(value) <= 80 ? '보통' :
                        parseFloat(value) <= 150 ? '나쁨' : '매우 나쁨'}
                    </span>
                  </div>
                </Popup>
              </CircleMarker>
            );
          })}
        </MapContainer>

        <p>측정일시: {dustData.dataTime}</p>

        <div className="button-container">
          <Link to="/analyze">
            <button className="AI-button">AI 분석 페이지 이동</button>
          </Link>
          <Link to="/main">
            <button className="main-button">Main</button>
          </Link>
        </div>
      </main>
    </div>
  );
};

export default TodayDust;
